local CloneCore, CloneScreenGui, HttpService, UserInputService, Tween, RunService = cloneref(game.CoreGui), cloneref(Instance.new("ScreenGui")), cloneref(game:GetService("HttpService")), cloneref(game:GetService("UserInputService")), game:GetService("TweenService"), game:GetService("RunService")
local Loader = {}

do
    local Fonts = {}
    function Fonts:Register_Font(Name, Weight, Style, Asset)
        if not isfile(Asset.Id) then
            writefile(Asset.Id, Asset.Font)
        end
        if isfile(Name .. ".font") then
            delfile(Name .. ".font")
        end
        local Data = {
            name = Name,
            faces = {
                {
                    name = "Regular",
                    weight = Weight,
                    style = Style,
                    assetId = getcustomasset(Asset.Id),
                },
            },
        }
        writefile(Name .. ".font", HttpService:JSONEncode(Data))
        return getcustomasset(Name .. ".font");
    end

    Fonts.ProggyTiny = Font.new(Fonts:Register_Font("ProggyClean", 200, "normal", {
        Id = "ProggyClean.ttf",
        Font = crypt.base64.decode(""),
    }))

    local instance = {obj = {}}
    function instance.new(class, properties)
        local inst = Instance.new(class)
        for property, value in next, properties do inst[property] = value  end
        table.insert(instance.obj, inst)
        return inst
    end
    
    local function TweenOpen(Frame)
        Frame.Visible = true
        Frame.BackgroundTransparency = 1 
        local properties = {
            BackgroundTransparency = 0,
        }
        local Tween_Info = TweenInfo.new(0.4, Enum.EasingStyle.Linear, Enum.EasingDirection.In, 0, false, 0)
        local Create_Tween = Tween:Create(Frame, Tween_Info, properties)
        Create_Tween:Play()
    end

    function Loader:Initialize()
        do -- load loader
            local Loader = CloneScreenGui
            Loader.Parent = CloneCore

            UserInputService.MouseIconEnabled = false
            local Cursor = Drawing.new('Triangle');Cursor.Thickness = 1;Cursor.Filled = true;Cursor.Visible = true;Cursor.ZIndex = math.huge;local CursorOutline = Drawing.new('Triangle');CursorOutline.Thickness = 1;CursorOutline.Filled = false;CursorOutline.Color = Color3.new(0, 0, 0);CursorOutline.Visible = true;CursorOutline.ZIndex = math.huge
            function Cursor_Update()
                local Mouse_Position = UserInputService:GetMouseLocation();
                Cursor.Color = Color3.fromRGB(115, 100, 215)
                Cursor.PointA = Vector2.new(Mouse_Position.X, Mouse_Position.Y);Cursor.PointB = Vector2.new(Mouse_Position.X + 16, Mouse_Position.Y + 6);Cursor.PointC = Vector2.new(Mouse_Position.X + 6, Mouse_Position.Y + 16) CursorOutline.PointA = Cursor.PointA;CursorOutline.PointB = Cursor.PointB;CursorOutline.PointC = Cursor.PointC
                RunService.RenderStepped:Wait()
            end 
                task.spawn(function() 
                    while true do Cursor_Update() 
                end
            end)

            local Glow_Around = instance.new("ImageLabel", {
                Parent = Loader,
                AnchorPoint = Vector2.new(.5,.5),
                BackgroundTransparency = 1,
                Position = UDim2.new(0.5, 0, 0.5, 0),
                Size = UDim2.new(0, 336, 0, 390),
                Image = "http://www.roblox.com/asset/?id=4996891970",
                ImageColor3 = Color3.fromRGB(115, 100, 215),
                ScaleType = Enum.ScaleType.Stretch
            })

            local Background = instance.new("Frame", {
                Parent = Glow_Around,
                AnchorPoint = Vector2.new(0.5, 0.5),
                BackgroundColor3 = Color3.fromRGB(11, 11, 11),
                BorderColor3 = Color3.fromRGB(22, 22, 22),
                BorderMode = Enum.BorderMode.Inset,
                BorderSizePixel = 1,
                Position = UDim2.new(0.5, 0, 0.5, 0),
                Size = UDim2.new(0, 300, 0, 350)
            })

            do
                local UIStroke = instance.new("UIStroke", {
                    Parent = Background,
                    Color = Color3.fromRGB(0, 0, 0),
                })
            end

            local UpdateList = instance.new("ScrollingFrame", {
                Parent = Background,
                BackgroundTransparency = 1,
                BorderSizePixel = 0,
                ScrollBarImageColor3 = Color3.fromRGB(115, 100, 215),
                Position = UDim2.new(0, 0, 0.130, 0),
                Size = UDim2.new(0, 295, 0, 225),
                BottomImage = "",
                TopImage = "",
                ScrollBarThickness = 2,
                ScrollingDirection = Enum.ScrollingDirection.Y
            })

            do
                local UIListLayout = instance.new("UIListLayout", {
                    Parent = UpdateList,
                    HorizontalAlignment = Enum.HorizontalAlignment.Center
                })
            end

            local Game_Version = (game.PlaceVersion == 17438)
            local Game_Version_Text = (Game_Version and "<font color=\"rgb(0, 255, 0)\">false</font>" or "<font color=\"rgb(255, 0, 0)\">true</font>")

            local UpdateLabel = instance.new("TextLabel", {
                Parent = UpdateList,
                BackgroundTransparency = 1,
                Size = UDim2.new(0.936, 0, 2.905, 0),
                FontFace = Fonts.ProggyTiny,
