                    "Game name: <font color=\"rgb(115, 100, 215)\">"..game:GetService("MarketplaceService"):GetProductInfo(game.PlaceId).Name.."</font>\n\n",
                    "Game has updated: [<font color=\"" .. (Game_Version and "rgb(0, 255, 0)" or "rgb(255, 0, 0)") .. "\">" .. Game_Version_Text .. "</font>]\n\n",
                    "[<font color=\"rgb(0, 255, 0)\">+</font>] Added silent aim\n\n",
                    "[<font color=\"rgb(0, 255, 0)\">+</font>] Added weapon icons\n\n",
                    "[<font color=\"rgb(0, 255, 0)\">+</font>] Added hitmarkers, tracers\n\n",
                    "[<font color=\"rgb(0, 255, 0)\">+</font>] Added weapon positions for drawings\n\n",
                    "[<font color=\"rgb(0, 255, 0)\">+</font>] Added more world esp options\n\n",
                    "[<font color=\"rgb(0, 255, 0)\">+</font>] Added custom textures\n\n",
                    "[<font color=\"rgb(0, 255, 0)\">+</font>] Added spider climb\n\n",
                    "[<font color=\"rgb(255, 0, 0)\">-</font>] Removed all unnecessary bits of code\n\n",
                    "[<font color=\"rgb(255, 255, 0)\">/</font>] Rewrote most of the code\n\n",
                    "[<font color=\"rgb(255, 255, 0)\">/</font>] Changed bypasses\n\n",
                }),
                TextColor3 = Color3.fromRGB(75, 75, 75),
                TextSize = 9,
                TextXAlignment = Enum.TextXAlignment.Left,
                TextYAlignment = Enum.TextYAlignment.Top
            })

            local TopBar = instance.new("Frame", {
                AnchorPoint = Vector2.new(0.5, 0.5),
                Parent = Background,
                BackgroundColor3 = Color3.fromRGB(11, 11, 11),
                BorderColor3 = Color3.fromRGB(22, 22, 22),
                BorderMode = Enum.BorderMode.Inset,
                Position = UDim2.new(0.5, 0, 0, 14),
                Size = UDim2.new(0, 300, 0, 30)
            })

            do
                local UIStroke = instance.new("UIStroke", {
                    Parent = TopBar,
                    Color = Color3.fromRGB(0, 0, 0),
                })
            end

            local TitleLabel = instance.new("TextLabel", {
                Parent = TopBar,
                BackgroundTransparency = 1,
                Position = UDim2.new(0, 0, 0, 0),
                Size = UDim2.new(0, 298, 0, 29),
                TextColor3 = Color3.fromRGB(75, 75, 75),
                RichText = true,
                Text = "ecstasy.<font color=\"rgb(115, 100, 215)\">wtf</font>",
                FontFace = Fonts.ProggyTiny,
